import React from 'react';
import './App.scss';
import { List } from './List/List';
import { FAMILIES } from './consts/families';

const App: React.FC = () => {
  return (
    <div className="App">
      <List name="Families" listItems={Object.values(FAMILIES)}></List>
    </div>
  );
}

export default App;
